UBIQUITILOCOM2		&#13;
			Ubiquiti establece el estándar para el primer Equipo en las instalaciones del cliente (CPE) de banda ancha eficiente y de bajo costo del mundo con la NanoStation® original. NanoStationM y NanoStationlocoM llevan el mismo concepto al futuro con factores de forma elegantes y elegantes, junto con la tecnología integrada airMAX® (protocolo MIMO TDMA). El bajo costo, el alto rendimiento y el factor de forma pequeño de NanoStationM y NanoStationlocoM los hacen extremadamente versátiles y económicos de implementar.
