MIKROTIKRB2011UiAS-RM



MIKROTIKRB2011UiAS-RM		&#13;
			Montaje en rack 1U, 5xEthernet, 5xGigabit Ethernet, USB, LCD, salida PoE en el puerto 10, CPU de 600 MHz, 128 MB de RAM, RouterOS L5
RouterBOARD 2011UiAS-RM, en comparación con la serie RB2011L, no solo tiene cinco puertos LAN Gigabit y cinco puertos LAN Fast Ethernet, sino que también tiene puerto serie RJ45, puerto USB y más RAM (128 MB en lugar de 64 MB). Además, tiene licencia RouterOS L5 (en lugar de L4) y una agradable pantalla LCD táctil para la configuración. La caja SFP también está presente (¡el módulo SFP no está incluido!)
Hay una función de salida PoE para el puerto n.º 10: puede alimentar otros dispositivos compatibles con PoE con el mismo voltaje que se aplica a la unidad. La carga máxima en el puerto es de 500 mA.
Probado y recomendado para usar con módulos SFP de MikroTik: S-85DLC05D, S-31DLC20D y S-35/53LC20D (no incluidos)
