			Punto de acceso de 2,4 GHz, 5 Ethernet, 5 Gigabit Ethernet, jaula SFP, USB, LCD, salida PoE en Eth10, CPU de 600 MHz, 128 MB de RAM
RouterBOARD 2011UiAS-2HnD tiene la mayoría de las funciones e interfaces de todos nuestros enrutadores inalámbricos. Está alimentado por el nuevo procesador de red Atheros 600MHz 74K MIPS, tiene 128 MB de RAM, cinco puertos LAN Gigabit, cinco puertos LAN Fast Ethernet y caja SFP (¡módulo SFP no incluido!). Además, cuenta con potente AP inalámbrico 802.11bgn de doble cadena de 2,4 Ghz (2312-2732 MHz, según la normativa del país), puerto serie RJ45, puerto USB y licencia de RouterOS L5, así como estuche de sobremesa con fuente de alimentación, dos antenas Omni de 4dBi y panel LCD &#8211; ¡Todo esto por sólo $129!
Probado y recomendado para usar con módulos MikroTik SFP: S-85DLC05D, S-31DLC20D y S-35/53LC20D (no incluidos)
RouterBOARD 2011UAS-2HnD-IN viene con gabinete de escritorio, panel LCD y fuente de alimentación.
